if (matches(seq)) {
return false;
}

boolean matchConsumeIgnoreCase(String seq) {
if (matchesIgnoreCase(seq)) {
bufPos += seq.length();
return true;
}

void emit(char c) {
emit(String.valueOf(c));
}
